  <script type="text/javascript">(function (diagram) { var SVGNS = "http://www.w3.org/2000/svg";

const popoverMarkdown = diagram.popoverMarkdown;

for (var shapeId in diagram.shapes) {
    var shape = diagram.shapes[shapeId];
    if (shape.Props && shape.Props.Item) {
        var node = document.getElementById(shapeId);
        var rect = node.querySelector("rect");
        var fe = document.createElementNS(SVGNS, "foreignObject");

        fe.setAttribute("x", rect.getAttribute("x"));
        fe.setAttribute("y", rect.getAttribute("y"));
        fe.setAttribute("width", rect.getAttribute("width"));
        fe.setAttribute("height", rect.getAttribute("height"));

        node.querySelector("text").remove();

        fe.innerHTML = marked(Mustache.render(popoverMarkdown, shape));

        node.appendChild(fe);
    }
}

diagram.selectionChanged.add(function (id) {

    let allItems = document.querySelectorAll(".item");
    for (let item of allItems) {
        item.querySelector("rect").style.fill = null;
    }

    if (id) {
        var data = diagram.shapes[id];
        if (data.ConnectedTo) {
            data.ConnectedTo.forEach(function (item) {
                document.getElementById(item).querySelector("rect").style.fill = "#Aff";
            });
        }
        if (data.ConnectedFrom) {
            data.ConnectedFrom.forEach(function (item) {
                document.getElementById(item).querySelector("rect").style.fill = "#fAf";
            });
        }

        document.getElementById(id).querySelector("rect").style.fill = "#ff0";
    }
}); })(window.svgpublish);</script>
